import React from "react";
 let Mind=()=>{
    return(<>
    <div className="container-fluid text-center mt-5 mind-bg">
        <h2> Your Peace of Mind</h2>
        <p className="fs-4">Through our conversion-focused strategies, we ensure that property<br/> seekers are not just visitors, but engaged prospects ready to make <br/> their next move in the real estate market</p>
        <button class="btn btn-primary col-2 p-3 rounded-pill align-self-start mb-5" type="button">Get started</button>        
  
    </div>
    </>)

 }
 export default Mind;
